  "dreps.faq.question1": "Was ist ein DRep?",
  "dreps.faq.answer1": "Ein DRep (Delegierter Vertreter) ist ein vertrauensvolles Gemeinschaftsmitglied, das im Namen von ADA-Inhabern ber Governance-Vorschlge abstimmt.",
