  "dreps.faq.faq": "Perguntas Frequentes",
  "dreps.faq.question1": "O que  um DRep?",
  "dreps.faq.answer1": "Um DRep (Representante Delegado)  um membro confivel da comunidade que vota em propostas de governana em nome dos detentores de ADA.",
  "dreps.faq.question2": "Por que devo delegar meu poder de voto?",
  "dreps.faq.answer2": "A delegao permite que voc tenha voz na governana do Cardano sem precisar revisar e votar em todas as propostas pessoalmente.",
  "dreps.faq.question3": "Como escolho um DRep?",
  "dreps.faq.answer3": "Voc pode selecionar um DRep baseado em seus valores, expertise e histrico de votao. Navegue pelos perfis e escolha um que se alinhe com sua viso para o Cardano.",
  "dreps.faq.question4": "Posso mudar meu DRep?",
  "dreps.faq.answer4": "Sim, voc pode re-delegar seu poder de voto para um DRep diferente a qualquer momento.",
  "dreps.faq.question5": "A delegao  segura?",
  "dreps.faq.answer5": "Sim, a delegao  segura. Seu ADA nunca deixa sua carteira e voc mantm controle total sobre seus fundos.",
  "dreps.faq.question6": "Ganho recompensas por delegar?",
  "dreps.faq.answer6": "Atualmente, a delegao  focada na participao na governana, no em recompensas financeiras.",
  "dreps.faq.question7": "Como os DReps tomam decises?",
  "dreps.faq.answer7": "Os DReps analisam cuidadosamente as propostas, garantindo votos informados e de alta qualidade que beneficiem o ecossistema Cardano.",
  "dreps.filters.status": "status",
  "dreps.filters.votingPower": "Poder de Voto",
  "dreps.filters.delegators": "Delegadores",
  "dreps.landing.title": "Molde o Futuro do Cardano, Delegue a um DRep Hoje!",
  "dreps.landing.subtitle": "Representantes Delegados (DReps) so membros da comunidade que representam os interesses da comunidade no Project Catalyst. Eles so eleitos pela comunidade para participar da governana do ecossistema Catalyst.",
  "dreps.landing.findDrep": "Encontrar um Drep",
  "dreps.landing.signUp": "Inscrever-se para ser um DRep",
  "dreps.landing.aDrep": "O que so DReps?",
  "dreps.landing.drepDescription": "DReps (Representantes Delegados) votam em propostas de governana no Cardano em nome dos detentores de ADA. Em vez de votar individualmente, voc pode delegar seu poder de voto a um DRep que representa seus interesses, ajudando a moldar o futuro do Cardano de forma eficiente e transparente.",
  "dreps.landing.projectCatalyst": "Crescimento Continuado do Project Catalyst e a Necessidade de Delegao",
  "dreps.landing.projectCatalystDescription": "O Project Catalyst da comunidade Cardano cresceu rapidamente, com o Fund8 recebendo quase 1.000 propostas. Para gerenciar essa carga de trabalho crescente, um novo sistema de delegao est sendo introduzido para governana sustentvel.",
  "dreps.landing.empower": "Empoderando Votantes Passivos Atravs da Delegao",
  "dreps.landing.empowerDescription": "A delegao permite que detentores de ADA atribuam seu poder de voto aos DReps, garantindo que suas vozes sejam ouvidas em mais propostas. Os DReps aprimoram a tomada de decises no Project Catalyst votando na maioria das propostas.",
  "dreps.landing.excite": "Animado com os DReps no catalyst?",
  "dreps.landing.answerExcite": "Entre e seja um pioneiro!",
